function highestAbsolute(a, b) {
  return Math.max(Math.abs(a), Math.abs(b));
}

console.log(highestAbsolute(-5, 3)); // Output: 5 (because |-5| = 5 and |3| = 3)
console.log(highestAbsolute(4, -7)); // Output: 7 (because |4| = 4 and |-7| = 7)
console.log(highestAbsolute(-10, -8)); // Output: 10 (because |-10| = 10 and |-8| = 8)
